                <MenuIcon />
                    <img
                    className = "header__logo"   
                    src = "https://havecamerawilltravel.com/photographer/files/2020/01/youtube-logo-new.jpg"
                    alt="hola"/>          

            </div>

            <div className="header__input">
                <input type="text" />
                <SearchIcon />

            </div>             
             <input type="text"/>
             <SearchIcon />
             <VideoCallIcon />
             <AppsIcon />
